import React from "react";
import BlocksRow from "./BlocksRow";

function BlocksBoard (props) {
    let BlocksBoard = [0,0,0,0,0,0,0,0]
    BlocksBoard = BlocksBoard.map((x,index) => <BlocksRow board_row = {props.board[index]} handlePiece = {props.handlePiece}/>)   
    return (
        <table className="board">
            {BlocksBoard}
        </table>
    )
    
}

export default BlocksBoard
